import torch
import torch.nn as nn
import main

#Author: Dino
class RNN(nn.Module):
    #USing the torch nn framework, make an NN with 2 hidden layers and including recurrence through LSTM
    def __init__(self):
        super(RNN, self).__init__()
        self.fc1 = nn.Linear(14, 16)
        self.relu1 = nn.ReLU()
        self.fc2 = nn.Linear(16, 16)
        self.relu2 = nn.ReLU()
        self.lstm = nn.LSTM(16, 16, batch_first=True)
        self.output = nn.Linear(16, 2)

    def forward(self, x):
        if not isinstance(x, torch.Tensor):
            x = torch.tensor(x, dtype=torch.float32)
        x = self.relu1(self.fc1(x))
        x = self.relu2(self.fc2(x))
        x = x.unsqueeze(0).unsqueeze(0)
        x, _ = self.lstm(x)
        x = x.squeeze(1)
        x = self.output(x)
        return x

    #Set weights for each simulation. Weights are in a list and are iteratively assigned
    def set_weights(self, weights_list):
        pointer = 0
        with torch.no_grad():
            for param in self.parameters():
                num_elements = param.numel()
                new_param = torch.Tensor(weights_list[pointer:pointer + num_elements]).view(param.size())
                param.data.copy_(new_param)
                pointer += num_elements

    #Runs the actual simulation using the passed weights
    def simulate(self, inputs, sim=True):
        self.set_weights(inputs)
        self.eval()
        with torch.no_grad():
            return main.runset(self, sim)

